f="tab4/3.webp",Of="tab4/4.webp",Pf="tab4/5.webp",Nf="tab4/6.webp",Mf="tab4/7.webp",kf="tab4/8.webp",Df="tab4/9.webp",Lf="tab4/10.webp";const Hf={name:"School"},Bf={class:"school"};function Ff(e,t,n,s,i,r){return F(),W("div",Bf,[...t[0]||(t[0]=[fs('<section class="content-section" data-v-ea32d720><div class="section-wrap" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Af+'" alt="Image 1" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 1</h2><p data-v-ea32d720>I stood on the ground, looking up at the lift towering above me. Sunlight poured down, illuminating the red steel structure and the white umbrellas above it. Against the clear blue sky, the scene felt both minimal and powerful. The rough industrial lines contrasted beautifully with the vast openness of the sky  a reminder that even the simplest structures can hold a kind of sculptural grace when touched by light.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap reverse" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Tf+'" alt="Image 2" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 2</h2><p data-v-ea32d720>I crouched by the water, trying to capture the reflection of this modern building. The surface was perfectly still, mirroring every line and shimmer of the metal facade. The warmth of the sunset softened the cold geometry of the architecture, while the surrounding greenery breathed life into the frame. I love how reflections blur the boundary between what&#39;s real and what&#39;s mirrored  a quiet dialogue between the man-made and the natural.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Rf+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 3</h2><p data-v-ea32d720>This was taken on a city street at dusk. The shadows stretched long between the tall buildings, while palm trees rose like silhouettes against the skyline. Golden light reflected off the glass windows, while the first city lights began to glow. Standing there, I felt that delicate balance between energy and stillness  the pulse of the city wrapped in the calm of evening light.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap reverse" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Of+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 4</h2><p data-v-ea32d720>Inside a dimly lit room, I captured two figures sitting quietly together. A single warm light cast long shadows across the floor. Their faces were half-hidden in shadow, their posture intimate yet distant. I wanted to capture that fragile tension  the way silence sometimes speaks louder than words. The interplay of light and darkness made the moment feel secret, almost cinematic.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Pf+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 5</h2><p data-v-ea32d720>I stood beside the carousel swings, watching people spin through the air. The blue sky, palm trees, and bursts of red and gold from the seats created a vibrant chaos of color. I waited for that perfect second  when laughter met light, and motion froze in midair. Theres something magical about these fleeting moments of joy; they remind me why I love photographing movement and human emotion.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap reverse" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+Nf+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 6</h2><p data-v-ea32d720>At a city intersection, I paused to take in the evening colors. The sky faded from soft violet to orange as palm trees stretched into the fading light. Street lamps flickered on, and the hum of the city began to settle. I framed the shot to capture that quiet romance of urban life  the ordinary turning beautiful under the glow of dusk.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap" data-v-ea32d720><div class="image-block" style="min-width:600px;" data-v-ea32d720><img src="'+Mf+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 7</h2><p data-v-ea32d720>This shot was taken from the base of a building, looking up toward the sunlight hitting its top edge. A palm tree leaned into the frame, its organic curve cutting through the buildings rigid geometry. The contrast of lines and textures drew me in. Through this perspective, I wanted to show how nature and architecture coexist  sometimes in harmony, sometimes in quiet tension.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap reverse" data-v-ea32d720><div class="image-block" data-v-ea32d720><img src="'+kf+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 8</h2><p data-v-ea32d720>Under the blazing sun, I moved through a crowd filled with laughter. People were relaxed, unguarded, fully present in the moment. Their bright clothes and sunlit faces created a rhythm of color and warmth. I wanted to capture that energy  the effortless happiness that comes with summer, when time feels slower and lighter.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap" data-v-ea32d720><div class="image-block" style="min-width:600px;" data-v-ea32d720><img src="'+Df+'" alt="Image 3" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 9</h2><p data-v-ea32d720>At the base of the Pacific Park Ferris wheel, I tilted my camera upward. The yellow beams and red cabins stood out vividly against the bright blue sky. The curves and angles of the wheel drew the eye in circles, echoing a sense of freedom and excitement. I love photographing scenes like this  where movement and emotion merge into one perfect visual rhythm.</p></div></div></section><section class="content-section" data-v-ea32d720><div class="section-wrap reverse" data-v-ea32d720><div class="image-block" style="height:560px;" data-v-ea32d720><img src="'+Lf+'" alt="Image 3" style="height:100%;" data-v-ea32d720></div><div class="text-block" data-v-ea32d720><h2 data-v-ea32d720>Image 10</h2><p data-v-ea32d720>From Griffith Observatory, I looked out over Los Angeles bathed in evening light. The city stretched endlessly below, fading into hues of gold, pink, and blue. The observatory stood silently, a witness to it all. From this height, the noise of the city disappeared, replaced by a calm, expansive stillness. Its in moments like this that Im reminded why I shoot  to capture the quiet poetry hidden inside something vast. </p></div></div></section>',10)])])}const Wf=cn(Hf,[["render",Ff],["__scopeId","data-v-ea32d720"]]),jf=[{path:"/",name:"home",component:lu},{path:"/beta",name:"beta",component:Fu},{path:"/smile",name:"smile",component:Ef},{path:"/school",name:"school",component:Wf}],Vf=Fc({history:vc(),routes:jf}),Yr=va(Na);Yr.use(Vf);Yr.mount("#app");
